import img1 from './img/previews/Apple BYZ S852I.svg'
import img2 from './img/previews/Apple EarPods.svg'
import img3 from './img/previews/Apple EarPods_.svg'

const headphones = [
    {
        title: 'Apple BYZ S852I',
        img: {img1},
        price: 2927,
        rate: 4.7,
        oldPrice: 3527,
    },
    {
        title: 'Apple EarPods',
        img: {img2},
        price: 2327,
        rate: 4.5,
